      SELECT DISTINCT + - COUNT ( * ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT ( 53 ) * - 57 * + CAST ( NULL AS INTEGER ) IS NOT NULL;
  - name: tab0
  - name: tab2

outputs:
  - name: q8908.out
    data: |
      -9
